        <option value="">Обратно</option>
        <option value="option1">Опция 1</option>
        <option value="option2">Опция 2</option>
        <option value="option3">Опция 3</option>
      </select>
      <button className='h-70 w-350 font-bold text-xl text-white bg-orange-500 rounded-16 p-2'>Найти рейс</button>
    </div>
    <div className='mt-6 flex items-center justify-center'>
      <h1 className='font-bold text-3xl'>Список всех доступных рейсов</h1>
    </div>
    <div className='h-400 w-550 mb-6 flex items-center justify-center'>
      {flights.map((FlightDetailsPage) => (
        <FlightCard key={FlightDetailsPage.id} {...FlightDetailsPage} />
